import React from 'react'
import { Link } from 'react-router-dom';

function NarbarRes() {
  return (
    <div className='nav'>
      <Link to="/homeres">Home</Link>
      <Link to="/bar">Bar</Link>
      <Link to="/restaurant">Restaurants</Link>
    </div>
  )
}

export default NarbarRes;
